from collections import Counter

class Solution:
    def minWindow(self, s: str, t: str) -> str:
        
        def isContain(s1: str, target: str) -> bool:
            d = dict(Counter(target))
            for s_i in s1:
                if s_i in d:
                    d[s_i] -= 1
            for val in d.values():
                if val > 0:
                    return False
            return True
        
        left, right = 0, 0
        n = len(s)
        ret_left, ret_right = 0, float('inf')
        while right < n:
            if not isContain(s[left:right], t):
                right += 1
            else:
                while left < right:
                    if isContain(s[left:right], t):
                        left += 1
                        if right - left + 1 < ret_right - ret_left:
                            ret_left = left - 1
                            ret_right = right
                    else:
                        break
                
        while left < right:
            if isContain(s[left:right], t):
                left += 1
                if right - left + 1 < ret_right - ret_left:
                    ret_left = left - 1
                    ret_right = right
            else:
                break
        
        if ret_right == float('inf'):
            return ""
        return s[ret_left:ret_right]


if __name__ == "__main__":
    s = ""
    t = ""
    print(Solution().minWindow(s, t))